import React from 'react';

class MemeGenerator extends React.Component{
	constructor(){
		super();
		this.state = {
			topText: "",
			bottomText: "",
			randomImg: "https://www.google.com/imgres?imgurl=https%3A%2F%2Fe7.pngegg.com%2Fpngimages%2F49%2F44%2Fpng-clipart-smiling-face-cartoon-illustration-trollface-smiley-internet-meme-face-expressions-miscellaneous-face.png&imgrefurl=https%3A%2F%2Fwww.pngegg.com%2Fen%2Fpng-bzxbj&tbnid=082kV-LhGfWNjM&vet=12ahUKEwjZ8J6e_oPrAhWpzIsBHepVBj4QMygCegUIARCoAQ..i&docid=0Tkaj9i1jN6e3M&w=900&h=674&q=troll%20face%20png&hl=en&ved=2ahUKEwjZ8J6e_oPrAhWpzIsBHepVBj4QMygCegUIARCoAQ",
			allMemeImg: []
		};
	}

	render(){
		return(
			<div>
				<h1>Meme Generator</h1>
				<img src={this.state.randomImg}/>
			</div>
			);
	}

}

export default MemeGenerator;
